function handsomePopup(name,description,price,url){var viewPort=Math.max(document.documentElement.clientWidth,window.innerWidth||0);if(viewPort>1200){createHandsomeHtml(name,description,price,url);createHandsomeCss()}}function createHandsomeHtml(name,description,price,url){var html=document.createElement("div");html.innerHTML='<div class="handsome-popup">'+"    <span class=\"handsome-popup-dismiss\" onclick=\"document.getElementsByClassName('handsome-popup')[0].style.display = 'none';\">x</span>"+'      <img src="data:image/png;base64," style="width:160px;" />'+"      <p>"+"        <strong>"+name+"</strong>"+"        "+description+"      </p>"+'      <a href="'+url+'" target="_blank" rel="noopener">'+"        <strong>Buy now</strong> $"+price+"      </a>"+"    </div>";document.getElementsByTagName("body")[0].appendChild(html)}function createHandsomeCss(){var css=document.createElement("style");css.type="text/css";css.innerHTML=""+"    .handsome-popup-dismiss {"+"      position:absolute;"+"      right:6px;"+"      top:4px;"+"      cursor: pointer;"+"      color: grey;"+"      font-weight:bold;"+"      font-size: 14px;"+"    }"+""+"    .handsome-popup {"+'      font-family: -apple-system, system-ui, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif;'+"      position:fixed;"+"      left:50px;"+"      bottom:-150px;"+"      background:#fff;"+"      box-shadow: 0 0 20px rgba(0,0,0,0.19), 0 0 6px rgba(0,0,0,0.23);"+"      padding:20px;"+"      color:#000;"+"      text-align: center;"+"    }"+""+"    .handsome-popup p {"+'      font-family: -apple-system, system-ui, BlinkMacSystemFont, "Segoe UI", Roboto, "Helvetica Neue", Arial, sans-serif;'+"      line-height:14px;"+"      font-size:14px;"+"      color:#000;"+"      margin-top:14px;"+"      margin-bottom:14px;"+"    }"+""+"    .handsome-popup img {"+"      display: inline-block;"+"    }"+""+"    .handsome-popup strong {"+"      font-weight:strong;"+"    }"+""+"    .handsome-popup a {"+"      width:100%;"+"      display:inline-block;"+"      text-decoration:none;"+"      color:#fff !important;"+"      background:#4CAF50;"+"      border:0;"+"      border-radius:4px;"+"      padding:6px;"+"      box-sizing:border-box;"+"      text-align:center;"+"    }"+""+"    .handsome-popup {"+"      -moz-animation: cssAnimation 250ms ease-in 8s forwards;"+"      -webkit-animation: cssAnimation 250ms ease-in 8s forwards;"+"      animation: cssAnimation 250ms ease-in 8s forwards;"+"      -webkit-animation-fill-mode: forwards;"+"      animation-fill-mode: forwards;"+"    }"+""+"    .handsome-popup.hide {"+"      display: none;"+"    }"+""+"    @keyframes cssAnimation {"+"      to {"+"        bottom: 0;"+"      }"+"    }"+"    @-webkit-keyframes cssAnimation {"+"      to {"+"        bottom: 0;"+"      }"+"    }";document.head.appendChild(css)}
